.card {
  font-family: monospace;
  text-align: left;
  color: #444444;
  background-color: #dcdcdc;
  font-size: 20px;
}


mark {
  padding: 0.25rem;
  margin-left: -0.125rem;
  border-radius: 5px;
}


.preamble {
  font-family: serif;
  color: #003300;
  font-size: 40%;
  font-style: italic;
  text-align: justify;
  margin-bottom: 2em;
}

.remarks {
  color: #220011;
  font-size: 80%;
}

.preambleSpan {
  display:inline-block;
}

.partOfSpeech {
  color: #660000;
}

.tatoeba {
  font-family: serif;
  text-align: center;
  list-style: none;
}

.tatoeba td {
  text-align: left;
}


.tatoeba table {
  text-align: left;
  width: 100%;
  height: 100%;
}

.tatoeba ul {
  padding: 0;
  margin: 0.25rem 0 0.25rem 0;
}


.tatoeba li {
 list-style: none;
 padding: 0;	
}


table {
  display: table;
  border-collapse: collapse;
  display: block;
  margin: 1.5rem 0;
  overflow: auto;
  width: 100%;
}

td,
th {
  border: 1px solid var(--border);
  padding: 0.25rem;
}

th {
  background: #cdcdcd;
  font-weight: bold;
}

tr:nth-child(even) {
  /* Set every other cell slightly darker. Improves readability. */
  background: #d0d0d0;
}

table caption {
  font-weight: bold;
  margin-bottom: 0.5rem;
}


