#left {
    font-size: 90%;
    float: left;
    width: 44%;
    height: 100%;
    overflow: scroll;
	overflow: hidden;
}
#right {
    font-size: 80%;
    float: right;
    width: 54%;
    height: 100%;
	overflow: hidden;
}
